    ### <reg-fdef>
    def ngram(icc=3)
        ### <region-function_docs>
        ### main:
        ###   - name : ngram 
        ###     desc : |
        ###         generate a dicware ngram of icc wordcount
        ### </region-function_docs>
        
        aout    = [];
        icc.times{ aout << dicewords()[rand(dicewords().length)] }
        aout.join('_');
    end
    ### </reg-fdef>

